NO CONTEST plea entered to count 1, bail jumping.  Convicted.
State moves to dismiss and read in counts 2 and 3.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for two (2) years.
Conditions of probation:
1)	Pay court costs;
2)	pay supervision fees in an amount to be determined by DOC;
3)	provide DNA sample;
4)	contact with the victim, D.B., only as approved by the agent;
5)	any counseling, treatment, assessments as recommended by the agent;
6)	maintain fulltime employment, schooling, work search or combination.
The defendant has credit for 12 days, if revoked.
